  false,\n\t\"url\": null,\n\t\"notes\": \"The data type contains data from aircraft
  surveys of herring schools. These data were collected to provide information on
  herring population density and distribution. Start date and time, start and end
  positions, and aircraft type, altitude and airspeed were reported for each survey.
  Surveys were conducted for preassigned areas; mid-point positions of census areas
  were reported. Environmental information may include meteorological conditions,
  sea state, air roughness and water clarity. Census data include species identification,
  school position and activity, school size index and number of schools sighted. Predominant
  beach type, biota type and escarpment type may also be indicated.\",\n\t\"owner_org\":
